import React from 'react'
import Articles from '../components/articles'
import Layout from '../components/layout'
import { getArticles, getCategories, getProductsByCondition } from '../lib/api'

const Home = ({ articles, categories }) => {
  return (
    <Layout categories={categories}>
      <div className="uk-section">
        <div className="uk-container uk-container-large">
          <h1>Strapi blog</h1>
          <Articles articles={articles} />
        </div>
      </div>
    </Layout>
  )
}

export async function getStaticProps() {
  let domain = "storagebinsell.com";
  let product_identify_cat = "folding crate"
  let condition = {"domain":{"name": domain}, "product_identify_cat": product_identify_cat}
  const articles = (await getProductsByCondition(condition)) || []
  console.log(`articles.length ==== ${articles.length}`)
  debugger
  const categories = (await getCategories()) || []
  return {
    props: { articles, categories },
  }
}

export default Home
